const pr = console.log;

// Accepted
const findAllRecipes = (recipes, ingredients, supplies) => {
    let g = new Map(), n = recipes.length, sup = new Set(supplies);
    for (let i = 0; i < n; i++) g.set(recipes[i], ingredients[i]);
    // pr(g);
    let q = [...sup], res = new Set();
    while (q.length) {
        operate(g, sup);
        let cur = q.shift(), next = g.get(cur) || [];
        // pr("cur", cur, "next", next, "sup", sup);
        for (const child of next) {
            if (sup.has(child)) continue;
            sup.add(child);
            q.push(child);
        }
    }
    for (const e of sup) {
        if (g.has(e)) res.add(e);
    }
    // pr("sup", sup, sup.size, "res", res.size);
    return [...res];
};

const operate = (g, sup) => {
    for (const [s, a] of g) {
        if (canMake(a, sup)) sup.add(s);
    }
};

const canMake = (ingredient, sup) => {
    for (const e of ingredient) {
        if (!sup.has(e)) return false;
    }
    return true;
};

const main = () => {
    let recipes = ["bread"], ingredients = [["yeast", "flour"]], supplies = ["yeast", "flour", "corn"];
    let recipes2 = ["bread", "sandwich"], ingredients2 = [["yeast", "flour"], ["bread", "meat"]], supplies2 = ["yeast", "flour", "meat"];
    let recipes3 = ["bread", "sandwich", "burger"], ingredients3 = [["yeast", "flour"], ["bread", "meat"], ["sandwich", "meat", "bread"]], supplies3 = ["yeast", "flour", "meat"];
    let recipe_debug1 = ["xevvq", "izcad", "p", "we", "bxgnm", "vpio", "i", "hjvu", "igi", "anp", "tokfq", "z", "kwdmb", "g", "qb", "q", "b", "hthy"],
        ingredients_debug1 = [["wbjr"], ["otr", "fzr", "g"], ["fzr", "wi", "otr", "xgp", "wbjr", "igi", "b"], ["fzr", "xgp", "wi", "otr", "tokfq", "izcad", "igi", "xevvq", "i", "anp"], ["wi", "xgp", "wbjr"], ["wbjr", "bxgnm", "i", "b", "hjvu", "izcad", "igi", "z", "g"], ["xgp", "otr", "wbjr"], ["wbjr", "otr"], ["wbjr", "otr", "fzr", "wi", "xgp", "hjvu", "tokfq", "z", "kwdmb"], ["xgp", "wi", "wbjr", "bxgnm", "izcad", "p", "xevvq"], ["bxgnm"], ["wi", "fzr", "otr", "wbjr"], ["wbjr", "wi", "fzr", "xgp", "otr", "g", "b", "p"], ["otr", "fzr", "xgp", "wbjr"], ["xgp", "wbjr", "q", "vpio", "tokfq", "we"], ["wbjr", "wi", "xgp", "we"], ["wbjr"], ["wi"]],
        supplies_debug1 = ["wi", "otr", "wbjr", "fzr", "xgp"];
    pr(findAllRecipes(recipes, ingredients, supplies));
    pr(findAllRecipes(recipes2, ingredients2, supplies2));
    pr(findAllRecipes(recipes3, ingredients3, supplies3));
    pr(findAllRecipes(recipe_debug1, ingredients_debug1, supplies_debug1));
};

main()

